import { useEffect, useState, useRef } from "react";
import { useNavigate } from "react-router-dom";

export default function AdminDashboard() {
  const navigate = useNavigate();
  const [admin, setAdmin] = useState(null);
  const [showProfile, setShowProfile] = useState(false);
  const profileRef = useRef(null);
  const [text,settext] = useState();

function set(){
    ste
}
  // Fetch admin details from local storage
  useEffect(() => {
    const storedAdmin = localStorage.getItem("admin");
    if (storedAdmin) {
      setAdmin(JSON.parse(storedAdmin));
    } else {
      navigate("/login"); // Redirect if no admin is logged in
    }
  }, [navigate]);

  // Logout function
  const handleLogout = () => {
    localStorage.removeItem("admin"); // Clear stored admin data
    navigate("/login"); // Redirect to login page
  };

  // Handle clicks outside the profile section
  useEffect(() => {
    function handleClickOutside(event) {
      if (profileRef.current && !profileRef.current.contains(event.target)) {
        setShowProfile(false);
      }
    }

    if (showProfile) {
      document.addEventListener("mousedown", handleClickOutside);
    } else {
      document.removeEventListener("mousedown", handleClickOutside);
    }

    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, [showProfile]);

  return (
    <div style={styles.body}>
      {/* Profile Icon at the Top Right */}
      <div style={styles.profileIcon} onClick={() => setShowProfile(!showProfile)}>
        👤
      </div>

      {/* Profile Dropdown (Visible on Click) */}
      {showProfile && (
        <div ref={profileRef} style={styles.profileCard}>
          <h3>👤 {admin?.name}</h3>
          <p><strong>Email:</strong> {admin?.email}</p>
          <p><strong>Role:</strong> Waste Management Admin</p>
          <button style={styles.logoutButton} onClick={handleLogout}>
            🚪 Logout
          </button>
        </div>
      )}

      {/* Dashboard Content */}
      <div style={styles.container}>
        <h2 style={styles.title}>Admin Dashboard</h2>

        {/* Waste Management Summary */}
        <div style={styles.summary}>
          <h3>Waste Management Summary</h3>
          <p>🔹 Total Reports Received: 120</p>
          <p>🔹 Reports Processed: 95</p>
          <p>🔹 Pending Reports: 25</p>
        </div>

        {/* Action Buttons */}
        <div style={styles.buttonContainer}>
          <button style={styles.button} onClick={() => navigate("/reports")}>
            📑 View Reports
          </button>
        </div>
      </div>
    </div>
  );
}

// Updated Styles
const styles = {
  body: {
